import React, { useState } from 'react'
import { Form, Button, Container } from 'react-bootstrap'
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const BookSave = () => {

    const navigator = useNavigate();

    const [title, setTitle] = useState('');
    const [author, setAuthor] = useState('');
    const [publisher, setPublisher] = useState('');
    const [price, setPrice] = useState(0);
    const [createdAt, setCreatedAt] = useState('');


    const setInputTitle = (e) => {
        setTitle(e.target.value);
    }

    const setInputAuthor = (e) => {
        setAuthor(e.target.value);
    }

    const setInputPublisher = (e) => {
        setPublisher(e.target.value);
    }

    const setInputPrice = (e) => {
        setPrice(e.target.value);
    }

    const setInputCreatedAt = (e) => {
        setCreatedAt(e.target.value);
    }


    const onClickSave = () => {
        console.log('title:', title, 'author:', author, 'publisher:', publisher, 'price:', price, 'created_at:', createdAt);
        axios.post('http://localhost:8080/api/bookSave', {
            title: title,
            author: author,
            publisher: publisher,
            price: price,
            created_at: createdAt
        }).then(res => {
            console.log(res.data);
            if (res.data > 0) {
                console.log('책 등록 성공');
                // 페이지 이동
                navigator('/bookList');
            } else {
                console.log('책 등록 실패');
            }

        }).catch(err => {
            console.log(err);
        }
        )
    }

    return (
        <div>
            <Container style={{ width: '60%' }}>
                <Form.Group className="mb-2" controlId="username">
                    <Form.Label>책 제목</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="책 제목을 입력하세요."
                        onChange={setInputTitle}
                        required
                    />
                </Form.Group>
                <Form.Group className="mb-2" controlId="password">
                    <Form.Label>저자</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="저자를 입력하세요."
                        onChange={setInputAuthor}
                        required
                    />
                </Form.Group>
                <Form.Group className="mb-2" controlId="username">
                    <Form.Label>출판사</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="출판사를 입력하세요."
                        onChange={setInputPublisher}
                        required
                    />
                </Form.Group>
                <Form.Group className="mb-2" controlId="username">
                    <Form.Label>가격</Form.Label>
                    <Form.Control
                        type="number"
                        placeholder="가격을 입력하세요."
                        onChange={setPrice}
                        required
                    />
                </Form.Group>
                <Form.Group className="mb-2" controlId="username">
                    <Form.Label>출간일</Form.Label>
                    <Form.Control
                        type="text"
                        placeholder="출간일을 입력하세요."
                        onChange={setCreatedAt}
                        required
                    />
                </Form.Group>

                <div className="mb-4"></div>

                <Button className="w-100" variant="primary" onClick={onClickSave}>
                    책 등록
                </Button>
            </Container>
        </div>
    );
}

export default BookSave;
